import styled from "styled-components";
import { Link } from "react-router-dom";

export const Nav = styled.nav`
  top: 0;
  left: 0;
  background-color: black;
  opacity: 0.5;
  position: absolute;
  height: 100vh;
  width: 50%;
  margin: auto;
`;

export const Li = styled.li`
  color: black;
`;

export const LinkTo = styled(Link)`
  color: black;
  text-decoration: none;
`;
